import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'; 
import './index.css';
import App from './App';

//렌더링 되고 있는 App컴포넌트를 브라우저라우터로 감싸준다.


ReactDOM.render(
<BrowserRouter> 
<App />
</BrowserRouter>,

document.getElementById('root')
);
